import React from "react";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogTitle from "@material-ui/core/DialogTitle";
import { makeStyles } from "@material-ui/core/styles";
import { ThemeProvider, createMuiTheme} from "@material-ui/core/styles";
import './CreateGroup.css'
import addImageLogo from '../images/add-image.png'
import CreateGroupButton from "./create-group-button"

const theme = createMuiTheme({
  overrides: {
    MuiPaper: {
      rounded: {
          borderRadius: '10px',
      }
    },
    MuiTypography: {
      h6: {
        fontSize: '2.3rem',
        fontFamily: 'Quicksand',
      }
    },
    MuiOutlinedInput: {
      inputMarginDense: {
        paddingTop: '5px',
        paddingBottom: '5px',
      }
    },
    MuiDialog: {
      paper: {
        outlineStyle: 'dashed',
        outlineOffset: '-15px',
        outlineColor: '#959595',
        borderStyle: 'solid',
        borderColor: '#959595',
        maxHeight: '50vh',
        minHeight: '50vh',
      }
    },
    MuiButton: {
      containedPrimary: {
        backgroundColor: '#75A8CB',
      },
      textPrimary: {
        color: '#75A8CB',
      }
    }
  },
  breakpoints: {
    values: {
      xs: 0,
      sm: 700,
      md: 960,
      lg: 1280,
      xl: 1920,
    },
  }
});

const useStyles = makeStyles(theme =>({
    root: {
      
    },
    buttonPos: {
        padding: "0 10px 30px 0",
        position: 'absolute',
        bottom: '0px',
        right: '20px',
    },
  }));

export default function CreateGroup() {
  const classes = useStyles();

  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  return (
    <ThemeProvider theme={theme}>
      <div>

        {/* <Button variant="contained" color="primary" onClick={handleClickOpen}>
          Click
        </Button> */}
        <CreateGroupButton  onButtonClick={handleClickOpen} />
        <Dialog
          open={open}
          onClose={handleClose}
          aria-labelledby="form-dialog-title"
          fullWidth={true}
          maxWidth = {'sm'}
        >
          <DialogTitle id="form-dialog-title">Create Group</DialogTitle>
          <DialogContent>
            <div className="dialog-container">
              <div className="textfield-container">
                  <p>Group Name:</p>
                  <TextField
                    margin="dense"
                    id="textfield-name"
                    type="text"
                    variant="outlined"
                    size="small"
                  />
                </div>
              <div className="textfield-container">
                <p>Course/Subject:</p>
                <TextField
                  margin="dense"
                  id="textfield-course"
                  type="text"
                  variant="outlined"
                  size="small"
                />
              </div>
              <div className="textfield-container">
                <p>Members:</p>
                <TextField
                  margin="dense"
                  id="textfield-members"
                  type="text"
                  variant="outlined"
                  size="small"
                />
              </div>
              <div className="image-container">
                <img className="image" src={addImageLogo} alt="add-logo" style={{ display: "inline-flex" }}/>
              </div>
            </div>
          </DialogContent>
          <DialogActions className={classes.buttonPos}>
            <Button onClick={handleClose} color="primary">
              Cancel
            </Button>
            <Button variant="contained" onClick={handleClose} color="primary">
              Create Group
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    </ThemeProvider>
  );
}
